mapper.select:

select 

from CLS_RPTDATA
where BASE_CUSTNO_ECIF = #{baseCustnoEcif,jdbcType=VARCHAR}
  and RPT_DATE = #{rptDate,jdbcType=VARCHAR}
  and RPT_TYPE = #{rptType,jdbcType=VARCHAR}

mapper.delete:

delete from CLS_RPTDATA
where BASE_CUSTNO_ECIF = #{baseCustnoEcif,jdbcType=VARCHAR}
  and RPT_DATE = #{rptDate,jdbcType=VARCHAR}
  and RPT_TYPE = #{rptType,jdbcType=VARCHAR}
